
def bbs(a, k):
	start = 0
	end = len(a) - 1
	while(start <= end):
		mid = (end + start)//2
		#print(start,end,mid)
		if (a[mid] == k):
			#print(k, a[mid])
			return mid
		elif (a[mid] > k):
			end = mid - 1
		else:
			start = mid + 1
	
	return None
	
	
