def GHN(a, m):
	# first check if a is empty
	
	if (a is None):
		return None
		
	# now perform BFS while keeping track of values as we want the highest values
	
	# prepare queue for BFS
	v = []
	# prepare dict for visited
	d = {}
	
	#prepare a list for sorting later, we choose a list because it can be easily sorted
	l = []
	
	# add root to queue and set visited to True
	v.append(a)
	d.setdefault(a, True)
	
	while (len(v) > 0):
		n = v.pop(0)
		
		print (n.value)
		
		# now add children of n to the queue we have
		for i in n.children:
			# only add i if it is not visited yet
			if (i not in d):
				# add this node to the queue and set visited to True
				v.append(i)
				d.setdefault(i, True)
				
				# also add this to a list for sorting later
				l.append(i)
				
	l.sort(key=getKey, reverse=True)
	
	if (len(l) < m):
		return l
	else:
		return l[:m]
		
		
