def pm(a):
	# first check if a is empty
	if (len(a) == 0):
		return True
		
	# first create a dictionary for eaiser access later
	d = {")":"(","}":"{",">":"<","]":"["}
	
	l = []
	
	for i in a:
		# this means that it's an opening parentheses
		if (i not in d):
			l.append(i)
		else: # this is a closing bracket
			if (len(l) == 0):
				return False
			n = l.pop()
			if (str(d[i]) != str(n)):
				return False
				
	if (len(l) > 0):
		return False
	
	return True
	
	
