# first implement the partition function

def pf(a,s,f):

	p = a[s]
	# this is the pivot index
	pi = s
	
	# print("%d %d" % (s,f))
	
	# now scan
	for i in range(s,f+1):
		# print("%d" % i)
		if (a[i] < p):
			# swap this guy with the one to the right to the pivot
			# and then swap the pivot and the one to the right to it
			# and then update the pivot index itself
			
			a[pi+1], a[i] = a[i], a[pi+1]
			a[pi+1], a[pi] = a[pi], a[pi+1]
			pi += 1
			
	return pi
	
# now implement the recursive quick sort

def qs(a,s,f):

	if (s > f):
		return
		
	if (s == f):
		return
		
	if (s == f - 1):
		if (a[f] <= a[s]):
			a[f], a[s] = a[s], a[f]
			return
			
	pi = pf(a,s,f)
	
	if (pi > s):
		qs(a,s,pi-1)
	if (pi < f):
		qs(a, pi+1, f)
		
		
# now change the above quick sort into an iteration
	
def qsi(a,s,f):

	if (s > f):
		return
		
	if (s == f):
		return
	
	if (s == f - 1):
		if (a[f] <= a[s]):
			a[f], a[s] = a[s], a[f]
			return
	
	pi = pf(a,s,f)
	
	stk = [[pi,s,f]]
	
	while(stk):
		n = stk.pop()
		
		if (n[0] > n[1]):
			pi = pf(a,n[1],n[0]-1)
			stk.append([pi,n[1],n[0]-1])
		if (n[0] < n[2]):
			pi = pf(a,n[0]+1,n[2])
			stk.append([pi,n[0]+1,n[2]])
	
	

# next task, sort a stack using push and pop

# think about it, if the stack is already sorted and you want to insert an element in it, what will you do
# well, you will need to keep popping until you find a suitable place and then push that element into it
# then you'll push is the elements you just popped

def insertinorder(s,e):
# first order of business of course is to check if the stack is empty

	if (not s or e < s[len(s)-1]):
		s.append(e)
		return
		
	# if not let's peel the stack one item at a time and recursively call the above
	
	n = s.pop()
	insertinorder(s,e)
	s.append(n)
	
# now what happens if the stack is not yet sorted, then we need to sort it

def sortstack(s):
	
	# like usual, check if the stack is empty or it only has one item
	if (not s or len(s) == 1):
		return


	# again peel the stack one item at a time and insert it in order after we sort the sub stack
	
	n = s.pop()
	sortstack(s)
	insertinorder(s,n)
		
	
# now try converting the above into an iteration

def insertinorderit(s,e):
# first order of business of course is to check if the stack is empty

	if (not s or e < s[-1]):
		s.append(e)
		return
		
	# if not let's peel the stack one item at a time and recursively call the above
	stk = []
	while (e > s[-1]):
		stk.append(s.pop())
	
	s.append(e)
	while (stk):
		s.append(stk.pop())
	

def sortstackit(s):

	# like usual, check if the stack is empty or it only has one item
	if (not s or len(s) == 1):
		return


	# again peel the stack one item at a time and insert it in order after we sort the sub stack
	
	n = s.pop()
	
	stk = [n]
	
	while(s):
		stk.append(s.pop())
		
	while(stk):
		insertinorderit(s,stk.pop())
	
	
