class CountPrimesSolution(object):
    def countPrimes(self, n):
        """
        :type n: int
        :rtype: int
        """
        if (n <= 2):
            return 0

        # using sieve method
        l = [1] * n
        l[0] = 0
        l[1] = 0
        
        for i in range(2,int(n ** 0.5) + 1 + 1):
            if (l[i] == 1):
                m = i
                while (i*m < n):
                    l[i*m] = 0
                    m += 1
                
        return sum(l)
        
        
        
