class BuySellStockSolution(object):
    def maxProfit(self, prices):
        """
        :type prices: List[int]
        :rtype: int
        """
        if (len(prices) <= 1):
            return 0
        
        d = DoublyLL()
        d.InsertList(sorted(prices[1:], reverse=True))
        
        p = 0

        cp = d.GetFirstValue() - prices[0]
        if (cp > p):
            p = cp
        
        for i in range(1,len(prices)-1):
            c = prices[i]
            cp = d.GetFirstValue() - c
            if (cp > p):
                p = cp
            d.RemoveValue(c)
            
        return p


class ReBuySellStockSolution(object):
    def maxProfit(self, prices):
        """
        :type prices: List[int]
        :rtype: int
        """
        if (len(prices) <= 1):
            return 0
        
        d = deque(sorted(prices[1:], reverse=True))
        
        p = 0

        cp = d[0] - prices[0]
        if (cp > p):
            p = cp
        
        for i in range(1,len(prices)-1):
            c = prices[i]
            cp = d[0] - c
            if (cp > p):
                p = cp
            d.remove(c)
            
        return p        
	
	
	
    
