class WordBreakSolution(object):

    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: bool
        """
        # s is guaranteed to be non empty so we don't need to do this
        # if (not s):
        #     return False
        
        if (s in wordDict):
            return True
        
        m = 1
        ln = len(s)
        
        g = False
        while(g == False):
            i = s[:m] in wordDict
            while(m < ln and i == False):
                m += 1
                i = s[:m] in wordDict
            #print(s[m:])
            if (i == False and m >= ln):
                return False
            else:
                c = s[m:]
                g = self.wordBreak(c,wordDict)
                #print(g)
                m += 1
            
                
        return True
        
        
        
        
