# Definition for singly-linked list.
class ListNode(object):
    def __init__(self, x):
        self.val = x
        self.next = None

class AddTwoNumbersSolution(object):
    # number must be non-negative integers
    def intoList(self, n):
        prev = None
        
        if (n == 0):
            return ListNode(0)
        
        while (n > 0):
            r = ListNode(n % 10)
            #print(r.val)
            if (prev is None):
                res = r
            else:
                prev.next = r
            prev = r
            n = n // 10
            #print("===%d" % n)
        return res
        
    # change list into number
    def intoNumber(self, l):
        if (l is None):
            return
            
        n = 0
        t = 1
        while (l is not None):
            n += l.val * t
            t = t * 10
            l = l.next
        return n

    def addTwoNumbers(self, l1, l2):
        """
        :type l1: ListNode
        :type l2: ListNode
        :rtype: ListNode
        """

        n1 = l1
        n2 = l2
        prev = None
        # cr means carry
        cr = 0
        
        while (n1 is not None or n2 is not None):
            r = ListNode(0)
            if (n1 is not None and n2 is not None):               
                r.val = n1.val + n2.val + cr
                n1 = n1.next
                n2 = n2.next
            elif (n1 is not None and n2 is None):
                if (cr == 0):
                    prev.next = n1
                    break
                r.val = n1.val + cr
                n1 = n1.next
            else:
                if (cr == 0):
                    prev.next = n2
                    break
                r.val = n2.val + cr
                n2 = n2.next

            
            cr = r.val // 10
            r.val = r.val % 10
            
            if (prev is None):
                res = r
            else:
                prev.next = r
            prev = r
            
        if (cr > 0):
            r = ListNode(cr)
            prev.next = r
            
        return res
        
        
        
