def LintoList(x):
    
    if (not x):
        return None
        
    n = ListNode(x[0])
    r = n

    for i in range(1,len(x)):
        n.next = ListNode(x[i])
        n = n.next
        
    return r
    

def XintoLists(x):
    l = []
    for i in x:
        l.append(LintoList(i))
        
    return l
        
        
