class MinStack(object):

    def __init__(self):
        """
        initialize your data structure here.
        """
        self.stk = []
        

    def push(self, x):
        """
        :type x: int
        :rtype: void
        """
        if (not self.stk):
            self.stk.append((x,x))
            return
        
        if (x < self.stk[-1][1]):
            self.stk.append((x,x))
        else:
            self.stk.append((x,self.stk[-1][1]))
        

    def pop(self):
        """
        :rtype: void
        """
        # we need to update min
        n, m = self.stk.pop()
        return n
        

    def top(self):
        """
        :rtype: int
        """
        return self.stk[-1][0]


    def getMin(self):
        """
        :rtype: int
        """
        return self.stk[-1][1]


