    def lowestCommonAncestor(self, root, p, q):
        """
        :type root: TreeNode
        :type p: TreeNode
        :type q: TreeNode
        :rtype: TreeNode
        """
        
        if (not root):
            return None

        # assumption is that p and q are validly in the tree
            
        if (root is p):
            return p
            
        if (root is q):
            return q
            
        lp = []
        lq = []
        
        self.getPath(root, p, lp)
        if (q in lp):
            return q
       
        # now check if p is an ancestor of q
        if (self.getPath(p.left, q, []) or self.getPath(p.right, q, []) ):
            return p
            
        # if it's not then backtrack the list to see which one contains q
        for i in range(2, len(lp)+1):
            if (self.getPath(lp[-i].left, q, []) or self.getPath(lp[-i].right, q, []) ):
                return lp[-i]
            
             
