class Solution(object):
    def findDuplicates(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        
            
            
        
        ln = len(nums)
        
        if (ln <= 1):
            return []
        
        i = 0
        r = []
        
        while(i < ln):
            if (nums[i] == i+1 or nums[i] == -1):
                i += 1
                continue
            
            n = nums[i]
            
            if (nums[n-1] == n):
                r.append(n)
                nums[i] = -1
                i += 1
                continue
                
            nums[i], nums[n-1] = nums[n-1], nums[i]
            
